// src/components/Weather.js
import React, { useState, useEffect } from 'react';
import { getWeather } from '../services/api';

const Weather = ({ location, startDate, endDate }) => {
  const [weather, setWeather] = useState(null);

  useEffect(() => {
    const fetchWeather = async () => {
      const data = await getWeather(location, startDate, endDate);
      setWeather(data);
    };

    fetchWeather();
  }, [location, startDate, endDate]);

  if (!weather) return <div>Loading...</div>;

  return (
    <div>
      <h2>Weather in {location} from {startDate} to {endDate}</h2>
      {weather.map((day, index) => (
        <div key={index}>
          <p>Date: {day.date}</p>
          <p>Temperature: {day.temp}Â°C</p>
          <p>Conditions: {day.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Weather;
